import styled from 'styled-components'
import {motion} from 'framer-motion'


export const IntroWrapper = styled.div`
width:100%;
height:100vh;
background:white;
box-sizing:border-box;
padding:25% 6% 4% 6%;
`;
export const AuthPanel = styled.div`
padding:4vh;
border:1px solid black;
border-radius:10px;
display:grid;

`;
